import React from 'react';
import Login from './login/Login';
import './App.css';
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom'

function App() {
  return (
    <Router>
      <div className="App">
        <Route path="/login" component={Login} />
        <Login/>
      </div>
    </Router>
  );
}

export default App;
